tool插件是默认内置插件无需下载安装，其中已经内置了一些工具，比如python，meteo-weather等，内置工具无需配置，可以直接使用。如果你想使用额外的工具，比如增加morning-news和bing-search两个工具，需要手动配置。你可以复制/plugin/tool目录下的config-template.json文件，重命名为config.json，按照以下示例进行配置：

```json
{
  "tools": ["bing-search", "news"],
  "kwargs": {
    "debug": true,
    "request_timeout": 120,
    "no_default": false,
    "bing_subscription_key": "4871f273a4804743",
    "morning_news_api_key": "5w1kjNh9VQlUc"
  }
}
```

更详细的步骤可以参考这里：https://github.com/zhayujie/chatgpt-on-wechat/tree/master/plugins/tool

